&quot;Dilliwaali Zaalim Girlfriend&quot; is an upcoming Romance Comedy film directed by Japinder Kaur,produced by Tarnpreet Singh JAP FILMS LLC and written by Manu Rishi.The film will feature Divyendu Sharma, Jackie Shroff, Kader Khan, Ira Dubey, Pradhuman Singh and Prachi Mishra. The film will be released on 20th March 2015.


